import React from "react";
import "./Discover.css";

function Discover() {
  return (
    <div className="container">
      <nav className="navbar">
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">Contact</a>
      </nav>
      <div className="search-filter-container">
        <SearchComponent />
        <FilterComponent />
      </div>
      <div className="results">
        <h2>Results</h2>
        <p>No results found.</p>
      </div>
    </div>
  );
}

function SearchComponent() {
  return (
    <div className="search-component">
      <input type="text" placeholder="Search" />
      <button>Go</button>
    </div>
  );
}

function FilterComponent() {
  return (
    <ul className="filter-component">
      <li className="filter-option">
        <input type="checkbox" id="filter1" />
        <label htmlFor="filter1">Filter 1</label>
      </li>
      <li className="filter-option">
        <input type="checkbox" id="filter2" />
        <label htmlFor="filter2">Filter 2</label>
      </li>
      <li className="filter-option">
        <input type="checkbox" id="filter3" />
        <label htmlFor="filter3">Filter 3</label>
      </li>
    </ul>
  );
}

export default Discover;
